description:
An ambitious young man, with a nave mother and a philandering father, returns home from college to discover that the girl next door has grown up in a very enticing way! As sexy as she is, he cant get her mother, who gave him one hot kiss before he left for college, out of his mind.

Dana DeArmond - (bio),Cameron Dee,Chloe Foster,Steven St. Croix,Seth Gamble,Marcus London

